import React from "react";
import Todo from "../models/todo";
import ToDoItem from "./ToDoItem";
import classes from './ToDos.module.css';

const ToDo: React.FC<{ items: Todo[], removeTodoHandler: (id: string) => void }> = (props) => {
  return (
    <ul className={classes.todos}>
      {props.items.map((item) => (
        <ToDoItem key={item.id} text={item.text} removeTodoHandler={props.removeTodoHandler.bind(null, item.id)}/>
      ))}
    </ul>
  );
};

export default ToDo;
